  (1399, 6, 'EncyPath_DownloadedData/Degasi/Orders', 'Alterra Search & Rescue Mission', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1400, 6, 'EncyPath_DownloadedData/Lifepods', 'Lifepods', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1401, 6, 'EncyPath_DownloadedData/AuroraSurvivors', 'Aurora Survivors', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1402, 6, 'Ency_CuteFish', 'Cute Fish', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1403, 6, 'EncyDesc_CuteFish', 'Cute Fish Description', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1404, 6, 'Ency_AuroraLore1', 'Aurora Auxiliary Mission Orders', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1405, 6, 'EncyDesc_AuroraLore1', ' - Search & Rescue - Crew of the Mongolian vessel \'Degasi\' - Ariadne Arm - Contact: Emissary Jochi Khasar, Aurora Passenger Quarters, Room 4 Mission brief: The Mongolian States lost contact with a Torgaljin Coproration vessel named \'Degasi\' shortly after it left colonized space. That was five years ago, and multiple rescue attempts since have failed. They have purchased passage aboard Aurora for Emissary Khasar, and your orders are to afford them every reasonable facility to locate and, if appropriate, retrieve the Degasi crewmembers, without compromising the primary mission. The Aurora is due to perform a gravity slingshot maneuver around planet 4546B approximately 13 months post-launch. This will bring the ship within range of the Degasi\'s last known position. Degasi crew manifesto has been distributed to senior employees in a separate data package.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1406, 6, 'Ency_AuroraLore2', 'Alterra Launches the Aurora', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1407, 6, 'EncyDesc_AuroraLore2', 'PHASEGATE ANNOUNCED FOR THE ARIADNE ARM: ALTERRA LAUNCHES THE AURORA The furthest reaches of inhabited space are due to expand, as Alterra Corp launches a newly-constructed capital ship, carrying a phasegate bound for the Ariadne Arm. The Aurora will travel from spacedock on the edge of Alterra space, making hundreds of consecutive phasegate jumps through nine different trans-gov authorities, and arrive on the far side of the Ariadne Arm in three months time. From there the command crew will pilot the ship beyond the final phasegate, arriving in the next solar system approximately 18 months later. There the elite team of engineers will begin a 6 month construction project on the new phasegate, a multi-trillion credit investment. Alterra Corp. currently operates 9% of all phasegates in the galaxy. If the Aurora\'s mission is successful Alterra will have outmaneuvered a cabal of Mongolian corporations, operating a range of outposts and mines in the region.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1408, 6, 'Ency_AuroraLore3', 'Trans-Gov Profile: Alterra Corp.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1409, 6, 'EncyDesc_AuroraLore3', ' - One of largest suppliers of spacefaring technologies and consumer electronics in the federation - The official supplier of the TSA - Consistently ranked amongst the Galaxy\'s best employers - Began life as a defense manufacturer in the mid-22nd century - National Motto/Slogan: \'Get what you deserve\' Although most trans-govs can trace their roots back to earth, Alterra - literally meaning \'by earth\' - is the only one brazen enough to take its name. During the Expansion, Alterra supplied arms to all sides, acquiring and housing a vast colonist workforce, and making the transition from manufacturer to state. The corporation\'s threat to cease trade was one of the turning points in the conflict, bringing about the end of hostilities and the signing of the Charter. Alterra holds the monopoly within its own borders. Free enterprise is encouraged; but competition is tight, all goods exported offworld must be Alterra branded, and profitable businesses are bought out by the state, owners ascending to the Alterra Board of Directors. Despite superficial similarities to national governments, the corporation\'s lawyers have always maintained that it has no legal obligation to its \'employees\', but voluntarily elects to take on the roles usually served by a democratically elected government. This claim has not yet been tested in Federation courts.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1410, 6, 'Ency_InnerBiomeWreckLore1', 'Search & Rescue: Paal Torgal', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1411, 6, 'EncyDesc_InnerBiomeWreckLore1', 'Auxiliary Search & Rescue: Paal Torgal Position: CEO of Torgaljin Corp, Captain of the \'Degasi\' Status: Lost in space, Ariadne Arm Age at time of disappearance: 79 Paal Torgal and his crew fell out of contact with Mongolian authorities five years ago. The vessel was insured for opportunistic search and rescue, and multiple vessels passing through the system have since attempted to trace the ship to no effect. It is hoped the Aurora\'s scanner suite can do better. - Made majority shareholder in Torgaljin Corp. by his mother upon her retirement - Interaction with Alterra limited to infrequent chartered munitions deliveries - Beneficiary of life extension technologies - Accompanied by his only child, Baat Torgal (19), heir to the Torgaljin Corporation - Emissary Khasar reports Torgal frequently traveled with fewer than the recommended skeleton crew - Inadequate systems maintenance may account for the ship\'s disappearance', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1412, 6, 'Ency_InnerBiomeWreckLore2', 'Search & Rescue: Baat Torgal', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1413, 6, 'EncyDesc_InnerBiomeWreckLore2', 'Auxiliary Search & Rescue Target: Baat Torgal Position: Vice President of Torgaljin Corp. Status: Lost in space, Ariadne Arm Age at time of disappearance: 19 - The only child of Paal Torgal - Beneficiary of enhanced learning techniques and cerebral implants - Digi-trained in advanced biochemistry and stellar economics - Emissary Khasar reports Baat was accompanying his father to a newly constructed space station where he was to serve a five year term as Chief Operating Officer', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1414, 6, 'Ency_InnerBiomeWreckLore3', 'Search & Rescue: Marguerit Maida', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1415, 6, 'EncyDesc_InnerBiomeWreckLore3', 'Auxiliary Search & Rescue Target: Marguerit Maida Position: Security Personnel Status: Lost in space, Ariadne Arm Age at time of disappearance: 42 - Freelance mercenary, born in the Mongolian States - Experienced in ship-to-ship and close quarters combat techniques - Tours of duty with the Mongolian Defense Force and the Trans-System Authority - Dishonorably discharged from the TSA 15 years ago for going off mission (details classified) - Emissary Khasar reports Maida was hired to accompany Paal Torgal onboard the Degasi into uncharted space, and defend the ship in case of pirate assault', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1416, 6, 'Ency_InnerBiomeWreckLore4', 'Alterra Citizen Testimonials', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1417, 6, 'EncyDesc_InnerBiomeWreckLore4', 'Frank told us this: \'I hear there are worlds out there where kids still learn from books. They go into a classroom every day, they memorize things, then later they have to write those things down again in controlled environments. Or worlds where everyone\'s supposed to be an artist! What use is learning to draw to someone who\'s going to work in human resources? On Alterra worlds, psychometric testing and specialized digi-training makes the most of everyone\'s talents.\' Max Zoinkoff: \'I started out in marketing for Alterra Survival Systems. It was good work, but I thought I could do better. I set up my own company, developing bespoke code for lifepod systems on capital ships. I sold up to Alterra ten years ago. Now I\'m on the board of directors, and I haven\'t looked back.\' George said, \'An average day for me starts at 10am. I live in a controlled habitat on Terra 17, so everything I need is less than five minutes away. I\'m a naturally empathetic person, so I took work as a companion. I spend my days visiting clients, talking with them, learning about them, paying them the attention that everyone needs and deserves, and like most people on Alterra worlds I\'m lucky enough to earn a living doing things I enjoy.\' Kaz says, \'We\'re lucky. We\'re free. We have jobs. There are trans-govs out there that do everything with robots, you know?\' Jamie had this to say: \'I design artificial worlds, including some of the most popular factory defaults. To do what I do you need to know what people really want. They want excitement, adventure, new experiences, to be whoever they want to be. My job is to make that happen. There are people who say we spend too much time escaping our lives and not enough time making them better. Those people are usually from outside of Alterra space.\'', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1418, 6, 'Ency_InnerBiomeWreckLore5', 'Trans-Gov Profile: Mongolian Independent States', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1419, 6, 'EncyDesc_InnerBiomeWreckLore5', 'When the hostilities of the Expansion ceased, the tactical value of a number of hard-to-reach colony systems on the outer rim of the China Territories plummeted. Recouping from the war, the central government left them to starve. The systems in question declared independence, claiming their infrastructure as their own, and their intent to become self-sufficient. Today the Mongolian States is seen as a relatively minor power on the outskirts of colonized space, yet it remains one of the fastest expanding trans-govs in the galaxy. There is little centralized control. In times of war, a defense force can be raised between the chief officers of the major planetary corporations. Mongolian societies inherited their technologies from the Chinese, but incorporated the customs of their multicultural colonist base. Non-synthetic foods remain popular. Religion is a strong component of society, but the Mongolians take a relaxed view of competing faiths, believing gods to be universally flawed, and equally defensible.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1420, 6, 'Ency_InnerBiomeWreckLore6', 'Aurora Engineering Drone - Log', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1421, 6, 'EncyDesc_InnerBiomeWreckLore6', ' [Exiting sleep mode. Loading voice recognition.] User: Berkeley: \'Drone, retrieve propulsion cannon.\' [Repulsion cannon retrieved] User: CTO: \'Berkeley, if you plug those wires in with that repulsion cannon you\'re going to depressurize engineering.\' User: Berkeley: \'Damnit. Drone, I said PRO-pulsion, not RE-pulsion.\' [Repulsion cannon retrieved] User: Berkeley: \'Drone, recalibrate external sensors!\' User: CTO: \'The sensors are fine. I made some tweaks to the language interface. Try treating it like a regular crewmember.\' [Sensors recalibrated] User: Berkeley: \'Drone, you suck. I know it\'s not your fault, but please take this thing off me, and bring me back a propulsion cannon. I\'m trying to plug in wires I can\'t reach, not depressurize engineering. Thanks for your time.\' [Retrieved propulsion cannon] User: Berkeley: \'Thank you. Now go away.\' [Entering hibernation mode] User: Berkeley: \'I like the tweaks.\' User: CTO: \'It keeps me busy until we get to go starside with what\'s in cargo bay.\'', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1422, 6, 'Ency_InnerBiomeWreckLore7', 'Aurora Scanner Room Voice Log', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1423, 6, 'EncyDesc_InnerBiomeWreckLore7', 'KEEN: The way I see it no one\'s to blame here. CREW 1: She gave me the wrong co-ordinates! CREW 2: He didn\'t give me clear instruction! KEEN: Okay, I\'ll rephrase: you\'ve been equally incompetent. Now, we\'ve lost time, but we\'re closer to the planet, so if the Degasi\'s out there the scan should pick it up. CREW 2: Why are we even helping the Mongolians? Aren\'t they the competition? KEEN: Enjoy your shore leave on Sanjei Station? Like having fuel in the tanks? Thank the Mongolians. We run the scans, we show the Mongols we didn\'t find anything, and we say thanks for the free dinner. Clear? CREW 1: Sir, there\'s something odd on the surface scan here.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1424, 6, 'Ency_InnerBiomeWreckLore8', 'Surveillance Log, Leisure Deck #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1425, 6, 'EncyDesc_InnerBiomeWreckLore8', '[Suspicious key word \'de-restricted\' detected. Beginning automated recording.] SUPPORT CREW: You picked that up when we docked with the Mongolian mining station? How much was it? TRADER: 3,000 credits. SUPPORT CREW: Including the extras? TRADER: *Whispers* And a counterfeit operator\'s license. SUPPORT CREW: No way the Mongols gave up a de-restricted transfuser for just 3,000. TRADER: It\'s called negotiation. You should have learnt it in school. SUPPORT CREW: Didn\'t move to Alterra \'til I was 16, negotiation class is younger. PASSENGER: It looks like the Alterra transfuser I have at home. TRADER: What do you have a \'fuser at home for? PASSENGER: Messing around. Turning the neighbour\'s dog blue. That kinda thing. TRADER: Well does your \'fuser have these ridges on the side? Ridges means no Alterra restrictions. SUPPORT CREW: I heard the Alterra model\'s more reliable. Looks better, too. TRADER: Are you joking? This is the finest transfuser in the galaxy! PASSENGER: I once found a diamond blade on Pandora for less than a thousand. TRADER: Pff, that\'s barely 250 shy of the Alterra price! PASSENGER: Still, that saving could have paid for this trip. TRADER: Wait, you paid less than 250?! I paid double that! PASSENGER: You should have learned to negotiate in school.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1426, 6, 'Ency_InnerBiomeWreckLore9', 'Unificationism', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1427, 6, 'EncyDesc_InnerBiomeWreckLore9', 'Religion has been scorned throughout space-faring history, but it has survived. By combining ancient meditative practices with the foresight of modern science, unificationist pantheism was born. Determinism teaches us that what has always been, always will be. The future is already decided, and free will is a myth. Gone are the days of casting guilt and original sin on all. Today we understand that we are born innocent, into lives we are not responsible for; we are atoms vibrating in the energy winds of space. Understanding that what we do has no meaning but for ourselves; and understanding that we are just as much a causal part of the universe as the universe is a causal part of us; we can understand that we give meaning to the universe and the universe gives meaning to us. We are people. But we are also gods. If we are gods, why do we feel imperfect? If there is no authority but our own, why do people keep telling us what to do? Unificationism has the answer. 300 credits for the opening seminar.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1428, 6, 'Ency_OuterBiomeWreckLore1', 'VR Suite Log', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1429, 6, 'EncyDesc_OuterBiomeWreckLore1', 'Loading program: DesertIslandDrama.vrat Size: 3 players Resources: Normal Spawning players on beach. Player 1 has been washed away by an unusually high tide. Player 2 has traded a coconut with player 3 for 10 credits. Player 3 has planted a coconut. Players are getting hungry. Player 3 has grown a coconut tree. Player 3 has eaten a coconut. Player 3 is no longer hungry. Player 3 has traded a coconut with player 2 for 30 credits. Player 2 has eaten a coconut but is still hungry. Player 3 has traded a coconut with player 2 in exchange for building a tent. Player 3 is sleeping inside their tent. Player 2 is cold. Night falls. A passing ship is offering trading. Player 2 has traded 30 credits for a musket. Player 3 has been shot twice in the head while sleeping. Player 2 wins. Player 2 has died of loneliness.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1430, 6, 'Ency_OuterBiomeWreckLore2', 'Alterra Alms Pamphlet', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1431, 6, 'EncyDesc_OuterBiomeWreckLore2', '\'Charity\' is an archaic concept which the realism of today\'s Alterrans has rendered obsolete. We understand that we are each responsible for ourselves, but the best way to get the most for ourselves is to work together with Alterra. The implication of this reasoning is clear: if someone is in need, they must find a way to be needed. Alterra Alms is a training academy for those in need. We\'re not a charity, because we don\'t ask for handouts - we prefer to think of ourselves as a philanthropic beneficence facilitation service promoting synergy between employer and workforce. AA operates on a lottery system. By investing any number of credits you will be entered into our prize draw. Larger investments yield higher chances of winning. Your credits will go toward training unskilled colonists in vital tasks such as maintenance and interpersonal skills. The colonists receive this training voluntarily and free of charge, on condition of a minimum contract with one of our investors on completion of their training. The joy of capitalism is that everybody wins! In the unlikely event we are unable to complete training that colonist is released without charge or contract back out into the world!', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1432, 6, 'Ency_OuterBiomeWreckLore3', 'The Charter', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1433, 6, 'EncyDesc_OuterBiomeWreckLore3', 'Definitions: Trans-gov - An independent authority in de facto control of at least one solar system and phasegate. Citizen - A person who consents, consciously or implicitly, to the authority of a recognized trans-gov. The Charter - The full legal contract agreed upon by 37 separate trans-govs, and summarized herein. The Trans-System Authority (TSA)- Military police charged with enforcing the terms of the Charter; independent of, but funded by, the trans-govs. Trans-System Phasegate - Any permanent installation which enables warping of spacefaring vessels between solar systems. Trans-gov Principles: 1. Each trans-gov is to have an equal right to the most extensive basic liberty compatible with a similar liberty for others. a. Each trans-gov has the right to own phasegates and planetary infrastructure b. Each trans-gov has an obligation to share phasegate access with other trans-govs on equal terms c. Each trans-gov has an obligation to financially maintain and comply with the TSA 2. Each trans-gov has the right to self-government, subject to the restrictions laid out below. a. No trans-gov may develop weapons and technologies outlawed in appendix 91 b. No trans-gov shall engage in population abuse', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1434, 6, 'Ency_OuterBiomeWreckLore4', 'Surveillance Log, Leisure Deck #3', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1435, 6, 'EncyDesc_OuterBiomeWreckLore4', 'PASSENGER 1: I just came onboard. I was visiting my daughter. She married a Mongolian, now they\'re with one of those awful mining operations. PASSENGER 2: I\'ve been onboard since Alterra space. My institute paid for the full journey as a research initiative. PASSENGER 3: I\'m just here for the experience. You can do all the VR you like, nothing compares with the real thing. PASSENGER 1: You mean you\'re here, for fun? For 18 months? Are you crazy? PASSENGER 3: What\'s crazy? PASSENGER 1: You\'re paying to stare at empty space. PASSENGER 3: That\'s not what I\'m paying for. I\'m paying for the adventure. PASSENGER 1: What adventure?! PASSENGER 3: The sort of adventure money can\'t buy. Life. This. Discovery. PASSENGER 1: I\'d rather discover the Martian Breach Resorts myself.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1436, 6, 'Ency_OuterBiomeWreckLore5', 'Torgaljin Corp.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1437, 6, 'EncyDesc_OuterBiomeWreckLore5', 'Torgaljin Corporation is a long-standing, family-run business that operates almost a dozen mining and trading operations. The company share price hit an all time high on the announcement by a cabal of Mongolian interests of their intention to construct a new phasegate utilizing Torgaljin materials. These plans were put on hold when Baat Torgal, the intended leader of the new mining operation, disappeared along with his father.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1438, 6, 'Ency_OuterBiomeWreckLore6', 'Join Alterra\'s Board of Directors', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1439, 6, 'EncyDesc_OuterBiomeWreckLore6', 'It\'s not about money. That\'s what every director on Alterra\'s board has told me - and I believe them. Profitability is just a temporary measure: power and status are the real goals. Make enough profit for Alterra Corp. and you\'ll be recognized by the most powerful businesspeople in the universe. Establish a company that obliterates the competition and - after compulsory buyout - you can be promoted to the Board of Directors. Perks include: - Travel: Free use of company phasegates - Entourage: Personal assistants for every facet of your life - Longevity: automatic organ replacement - Alterra: Get what you deserve', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1440, 6, 'Ency_OuterBiomeWreckLore7', 'Responsible Autonomous Relationships', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1441, 6, 'EncyDesc_OuterBiomeWreckLore7', 'Foreword, by Robin Eklund All the good things in life are commodities. We trade love just as we buy and sell stock. We engage in human relationships when there is a fair exchange of value - be that support, motivation, challenge, learning - nothing good is ever for free. If every physical good in the galaxy came from a single supplier, that would constitute a dangerous monopoly. Personal relationships are the same: it is important for people to get what they need from multiple sources. Further, if someone finds a better source of the goods they require, they should be free to add it to or replace their existing supplier. If one member of a relationship should feel threatened or jealous, they must look at their own business model and ask whether it is performing competitively. There is always room for improvement.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1442, 6, 'Ency_OuterBiomeWreckLore8', 'Relationship Contract Legal Recording', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1443, 6, 'EncyDesc_OuterBiomeWreckLore8', 'ENGINEER: Listen, I know I don\'t have the right to make demands of you, but I need you to understand that I want to change our relationship. SUPPORT CREW: I hear what you\'re saying and I will try to respect it. How would you like to change it? ENGINEER: I would like to reduce our contact hours. SUPPORT CREW: How much further can we do that? ENGINEER: To zero. SUPPORT CREW: You\'re dumping me?! ENGINEER: I\'m changing the terms of our relationship. SUPPORT CREW: Is it still a relationship if we don\'t see each other? ENGINEER: Of a kind. You have so many expectations. SUPPORT CREW: I feel you just want to spend more time with those guys on the leisure deck. ENGINEER: I feel hostility in what you\'re saying, and that jealousy is a possessive emotion. Why can\'t you be happy for me? SUPPORT CREW: I am happy for you, and I\'m happy for the guys on leisure deck. I\'m just not happy for me. ENGINEER: Which is why I want to change our relationship.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1444, 6, 'Ency_OuterBiomeWreckLore9', 'Surveillance Log, Leisure Deck #2', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1445, 6, 'EncyDesc_OuterBiomeWreckLore9', '[Suspicious key word \'religious\' detected. Beginning automated recording.] KHASAR: You Alterrans, you think you have it all. But in the Mongolian States we have the freedom to work for ourselves. CREW: Hey, most of us are contractors! Jo owns her own company! KHASAR: Whose ship are you living on right now? Yours, or Alterra\'s? CREW: You\'d do well to remember whose ship you\'re on, Mongol. KHASAR: I\'d say this ship belongs to all people. We\'re all part of the same system, the only difference between us is where we choose to draw lines. CREW: Religious nonsense. You guys are nothing but a cabal of cowboy corporations fighting over rocks on the far reaches of space.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1446, 6, 'Ency_OuterBiomeWreckLore10', 'Profitability Projections', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1447, 6, 'EncyDesc_OuterBiomeWreckLore10', 'Two choices: A) Carry on working long-haul missions on the outer reaches of space; B) Come up with a profitable business, sell out to Alterra, live happily ever after. I choose B. Ideas: - A robot that builds other robots (don\'t they have those already?) - A laser cutter that has infinite battery life (solar power? body heat? do suns last forever? check this) - A phasegate that can be built by self-repairing robots instead of poor lonely humans on an 18 month mission (what happens when something goes wrong?) - A VR program that precisely simulates real life down to the finest detail (how do I know they didn\'t already invent it and we\'re inside it right now? wouldn\'t want an intellectual property challenge...) - A gun that shoots other, smaller guns (can\'t see any real objections to this one)', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1448, 6, 'Ency_Lifepod1', 'Danby\'s Flight Recorder', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1449, 6, 'EncyDesc_Lifepod1', 'This is medical officer Danby, I\'m breaking atmosphere at high velocity, planetfall in 20 seconds! *Explosion* Taking fire! Going into a spin! Attempting- *Static*', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1450, 6, 'Ency_Lifepod2', 'Lifepod Flight Recorder #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1451, 6, 'EncyDesc_Lifepod2', 'PASSENGER: We\'re sinking! CREW: Ma\'am, I\'m doing everything that I can! PASSENGER: Where are the support teams?! CREW: They\'re on their way, Ma\'am! PASSENGER: That\'s not what he said on the radio! CREW: Ma\'am, I have to ask you to stay where you are! The computer hasn\'t completed situational analysis, we\'ve no idea what\'s out there! PASSENGER: I will not drown in here! CREW: Ma\'am, come back, it\'s not safe! *Reaper sounds*', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1452, 6, 'Ency_Lifepod3', 'Engineers\' Flight Recorder', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1453, 6, 'EncyDesc_Lifepod3', 'PDA: Situational analysis complete. Communications relay offline. ENGINEER 1: Frack it! How are we going to make the rendezvous without a radio signal? ENGINEER 2: We have a compass bearing. We\'ll have to do it the old fashioned way. ENGINEER 1: You want to fabricate a compass? ENGINEER 2: Why stop there? If we find the others, we can build stillsuits. Construct habitats. Maybe even make it to the Aurora and reactivate the interstellar communications. You have a welder? ENGINEER 1: Yeah I- Damn it, I left it in the exo bay. ENGINEER 2: Don\'t sweat. ENGINEER 1: No, I fracked up. ENGINEER 2: No, we can do this. All we need is some basic materials. This planet can\'t be barren. Let\'s get out there and find out.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1454, 6, 'Ency_Lifepod4', 'Emissary Khasar\'s Flight Recorder', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1455, 6, 'EncyDesc_Lifepod4', 'Blackbox Data #345 00:00 Lifepod systems online. 00:03 Passenger 07 \'Emissary Jochi Khasar\' has boarded the lifepod. 00:07 Lifepod launch sequence initiated. 00:15 Lifepod detached from Aurora OK. 00:17 Onboard microphones detecting voice communications, recording: \'Our creators, who art gracious and merciful, hallowed be thy names. Praise be to you, the glorious one, the cherisher and sustainer of worlds. Give us this day our daily goods, and allow us our pleasures, as we allow those who seek pleasure from us.\' 00:33 Entering planetary atmosphere. 00:35 External temperature approaching critical levels. 00:37 \'Show us the straight path, the path of those you favor. In Life, Truth, Love, the wholeness of reality. In Substance, Principle and Mind, man is its image and likeness. For ours is the power, we are the one. For ever and ever. Athem.\' 01:02 Exterior hull damage sustained. 01:05 Life support systems failed. 01:06 Impact imminent.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1456, 6, 'Ency_LifepodSeaglide', 'Lifepod Voicelog #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1457, 6, 'EncyDesc_LifepodSeaglide', 'This may be my last report. The lifepod made planetfall intact, but now it\'s surrounded by some kind of aquatic alien predator. They\'re encased in a carapace armour, and attack the moment I open the hatches. The first one that came at me I attacked with the survival knife, but it got lodged in the armor layers. Tried distracting them with flares - no effect. No propulsion cannon available. No stasis rifle. No chance. I\'ve stripped some of the lifepod electrics to manufacture a seaglide. My only hope is I can outrun them. Wish me luck.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1458, 6, 'Ency_LifepodKeenDialog', 'Officer Keen\'s Flight Recorder', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1459, 6, 'EncyDesc_LifepodKeenDialog', 'CAPTAIN: Keen! This is Aurora, come in! KEEN: I hear you, Captain! CAPTAIN: The computer has identified a landmass at the attached coordinates! I want you to regroup the crew there! KEEN: Understood, but- CAPTAIN: They\'re your responsibility now, don\'t let me down! KEEN: Captain, you need to evacuate! *Explosion aboard the Aurora* KEEN: Captain?!', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1460, 6, 'Ency_LifepodKeenLog', 'Officer Keen\'s Log #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1461, 6, 'EncyDesc_LifepodKeenLog', 'To all crew - If you are reading this then you have followed the automatic distress signal broadcast by this lifepod\'s onboard computer, contrary to protocol. My lifepod was damaged on impact and I am forced to evacuate. Your orders are to disregard my safety and attempt to reach the designated regroup co-ordinates at the nearest landmass. I hope to see you there. - Second Officer Keen', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1462, 6, 'Ency_LifepodCrashZone1', 'Lifepod Voicelog #2', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1463, 6, 'EncyDesc_LifepodCrashZone1', 'CREW: I need you to stay calm. The hull\'s secure. We\'re not in immediate danger. PASSENGER: Where are the rescue teams?! CREW: The Aurora didn\'t make it, Ma\'am. PASSENGER: What do you mean? CREW: They\'re dead, ma\'am. They\'re all dead. PASSENGER: What do you intend to do about it? CREW: We can\'t wait here for rescue. We\'re going to have to fabricate radiation suits and make for the crash site. PDA: Detecting local metal deposits. CREW: The PDA\'s interfacing with the fabricator okay. We\'ll have to go outside for the materials. PASSENGER: We?! It\'s your job, isn\'t it? To look after the passengers! CREW: Within reasonable parameters. PASSENGER: I beg your pardon? CREW: Forget it, I\'ll go. Just don\'t assume I\'ll find enough materials for the both of us.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1464, 6, 'Ency_LifepodCrashZone2', 'Lifepod Voicelog #3', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1465, 6, 'EncyDesc_LifepodCrashZone2', '*Hatch closes* CREW: *Coughing* Here, take this. PASSENGER: What do I do?! CREW: I pre-programmed the fabricator, just plug in the materials! FABRICATOR: Radiation suit fabricated. PASSENGER: It says there\'s only enough materials for one. CREW: It\'s all I could find. You\'ll have to take it. PASSENGER: To be clear, you want me to leave you here? CREW: Frack me, no! Find Officer Keen at the rendezvous, and send someone back for me with anti-rad meds, you incompetent, ungrateful- PASSENGER: Well if that\'s going to be your attitude- CREW: *Violent coughing* PASSENGER: OK, OK, I\'m going! *Hatch opens* CREW: And stay clear of the crash zone in case the drive core goes up!', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1466, 6, 'Ency_LifepodCTODialog1', 'CTO Voicelog #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1467, 6, 'EncyDesc_LifepodCTODialog1', 'CTO: We\'re sinking! The flotation devices must have failed! TECHNICIAN: Should we evacuate?! CTO: No! The seafloor shouldn\'t be more than a couple hundred meters down. We\'re safer in here than out there. TECHNICIAN: There\'s water coming in! CTO: Wait, I can reconfigure the O2 system to act as a bilge! TECHNICIAN: It\'s working! *Crash* CTO: You okay?! TECHNICIAN: I think so... CTO: OK, good news or bad? TECHNICIAN: Good. CTO: We\'re alive, and we\'ve stopped sinking. TECHNICIAN: Bad? CTO: The O2\'s going to run out in 30 minutes! TECHNICIAN: Frack! What do we do? CTO: Let me think.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1468, 6, 'Ency_LifepodCTODialog2', 'CTO Voicelog #2', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1469, 6, 'EncyDesc_LifepodCTODialog2', '*Sound of water inside the lifepod* CTO: According to these pressure readings we\'ve sunk more than 400m. TECHNICIAN: So let\'s just build a flotation device, or a seaglide, and make for the surface. CTO: We\'ll never make it without air tanks. It\'s too far. TECHNICIAN: *Spluttering* I don\'t want to pressure you, but my feet aren\'t touching the floor anymore. CTO: I\'ve got it! There\'s another lifepod nearby, a hundred meters from here. If we can make it there, we can resupply our O2 tanks then head for the surface! TECHNICIAN: What if that pod\'s screwed too?! CTO: Then we\'re screwed too, but no more than we are already! TECHNICIAN: I\'m ready.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1470, 6, 'Ency_LifepodCTOLog1', 'CTO Log #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1471, 6, 'EncyDesc_LifepodCTOLog1', 'Entry 1 Screw this planet! Technician Berkeley and I were forced to abandon our lifepod when it hit the ocean floor. We swam for this pod, but Berkeley ran out of air on the way here. And I don\'t know how, but we\'re not in open water. There\'s no natural light here. There\'s a roof overhead, and no obvious way out. Lifepod must have rolled down into a cave system of some kind. Might be I can use a dive reel and compass to chart a way out. Might be I\'m going to breathe my last down here. Entry 2 Two hours since the first pod sunk. I\'ve tried exploring the area. There\'s no air pockets. No overhead exit. If I had plasteel I could build an air tank, a submersible, anything! But as it is I can only explore so far before I\'m forced back to this lifepod. I have to find another way. Entry 3 I\'ve managed to cobble together a rebreather and explore a bit further. I\'ve found an incline heading up. Not clear whether it\'s part of the cave wall, or the way out. One way to know for sure. Entry 4 Daylight! It was definitely daylight, I\'m sure of it. I swam as far as I could. Next time I have to go past the point of no return and take my chances. If any rescue party finds this, please retrieve Berkeley\'s body, if the fish don\'t get to it first. I will now attempt to make it to the surface and regroup with Keen and anyone else that made it. - Chief Technical Officer Yu', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1472, 6, 'Ency_LifepodCTOLog2', 'CTO Log #2', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1473, 6, 'EncyDesc_LifepodCTOLog2', 'This beacon marks the beginning of a major cave system. Strong currents dragged our lifepod down. Do not pass this point for fear of death. - Chief Technical Officer Yu', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1474, 6, 'Ency_IslandsPDABase1Interior', 'Paal Torgal\'s Log #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1475, 6, 'EncyDesc_IslandsPDABase1Interior', 'I am Paal Torgal, Chief Executive Officer of the Torgaljin Corporation. My crew and I were marooned here 5 weeks ago when our ship was struck by some kind of weapon. We constructed a habitat using materials reclaimed from the ship. We survived by cultivating indigenous flora. The biochemistry imprint I commissioned for my son has already paid for itself. He has grown enough food to last us a month. Now I fear for our safety. A mercenary I hired for the journey, Marguerit Maida, is increasingly disturbed. She insists we abandon this site and establish a habitat underwater. I fear she may take steps to sabotage our habitat here to enforce her own agenda. Nonetheless, and against my better judgement, I have acquiesced to her request to scout for a suitable aquatic site. My hope is she will quickly realize how unforgiving the ocean is, and abandon this foolish ambition.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1476, 6, 'Ency_IslandsPDABase1a', 'Baat Torgal\'s Log #6', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1477, 6, 'EncyDesc_IslandsPDABase1a', 'I messed up. Real bad this time. It\'s been two days since what happened. We never should have left this island. I shouldn\'t have listened to them. We shouldn\'t have gone so deep. They don\'t want us down there. They don\'t trust us. I knew it and I didn\'t say. I could see it, and they couldn\'t, and now they\'re stuck down there, and I\'m up here, alone. I deserve this.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1478, 6, 'Ency_IslandsPDABase1bDesk', 'Degasi Voice Log #1', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1479, 6, 'EncyDesc_IslandsPDABase1bDesk', 'MARGUERIT: It won\'t work, Chief. We salvaged enough scrap from the Degasi for, what, a couple of observatories? PAAL: It\'ll be enough. MARGUERIT: For now. And then we\'ll run out. Ain\'t no building materials on this island. We\'re gonna have to get our feet wet. No other way. PAAL: This island is safe. There\'s fertile land. No predators. Shelter from the elements. MARGUERIT: All we\'d need is a water filtration system, some hull reinforcements, maybe a thermal plant or two... PAAL: I\'ve made my decision. You want to forfeit your commision just to take a swim? MARGUERIT: Believe me, I\'m thinking on it. BAAT: Those mountains look like they get the most of the sun. If we built observatories up there I think I could grow enough food to keep us all alive. I think this could work. PAAL: You hear that? You think you know better than 10 million credits of biochem training? MARGUERIT: It\'s not the kid I doubt. All I\'m sayin\' is, ocean\'s got us surrounded. No use hiding. PAAL: No. This is where we build. This is how we survive.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1480, 6, 'Ency_IslandsPDABase1Desk', 'Degasi Voice Log #2', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1481, 6, 'EncyDesc_IslandsPDABase1Desk', 'PAAL: Your life is worth more. I forbid you go out there. BAAT: I stopped needing your permission when the ship you were captaining sunk. PAAL: You will stop needing my permission the day I cease to be your father! MAIDA: Say, Chief. Chief! PAAL: What? MAIDA: Do you know how to drain those grow beds out there of 40 tons of storm water? Or where we\'ll find food for three people for the next two weeks? PAAL: You know I don\'t. MAIDA: So what\'s your boy\'s life worth to you today, if next week you\'re gonna be so hungry you start wondering what he tastes like? Let him go cover the plants. PAAL: Son, go cover the plants. CPU: Baat Torgal is no longer aboard the habitat. PAAL: Interfere with my family again and when the rescue team arrives I will leave you here. You understand me? MAIDA: No rescue coming, Chief. Not in time. And no stayin\' here, neither. This rain keeps falling, and sooner or later this place\'ll be buried. Only choice we\'ve got is whether we get buried with it. PAAL: Stay away from my boy.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1482, 6, 'Ency_IslandsPDAExterior', 'Degasi Voice Log #3', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1483, 6, 'EncyDesc_IslandsPDAExterior', 'MARGUERIT: You see, Chief? You brought us to this fracking planet. You told us we\'d see a lush payday. Now what do we got? Half of us dead. A pile of fracking dirt in our front room. Rain coming in the through the windows. PAAL: And you would have avoided this how? MARGEURIT: I woulda started by not taking an unscheduled detour. You NEVER go off course. That\'s something you gotta learn the hard way. Now you know. PAAL: What exactly do you propose? MARGEURIT: You want to waste what time you have left lugging titanium up from the seabed? Or you want to hit this thing head on? PAAL: If we build underwater, what will we do for food? Drinking water? Power? MARGEURIT: We\'ll go fishing. Build water filters. We go deep enough we gotta find thermal vents - we\'ll have more power than we could ever use. Chief, we\'ll eat fracking seaweed salad if that\'s what it takes. Or you got something better? BAAT: I think I could make a good seaweed salad. PAAL: Son, the adults are talking. BAAT: I\'m serious, father. If I can grow fruit on the land, I can grow seaweed underwater. We can farm fish. Father, I kept us alive this long. I can keep on doing it.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1484, 6, 'Ency_JellyPDABrokenCorridor', 'Degasi Voice Log #4 - Jellyshroom Arrival', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1485, 6, 'EncyDesc_JellyPDABrokenCorridor', 'BAAT: This place is rad. PAAL: It\'s not what I expected. Have you factored in the pressure on the hull construction? MARGUERIT: I reinforced the hull, installed bulkhead doors. PAAL: Of course. BAAT: We could build an observatory deck. We could learn a lot here. MARGUERIT: Now, the foundations... they\'re not in the best of shape. But I guarantee you, if this place comes loose it won\'t be the fall that kills us.', '2016-10-20 01:27:14', '2016-10-20 01:27:14'),
  (1486, 6, 'Ency_JellyPDARoom2Desk', 'Degasi Voice Log #5 - Deeper?!', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1487, 6, 'EncyDesc_JellyPDARoom2Desk', 'PAAL: We\'re already 300m below sea level! You want to go DEEPER?! MARGUERIT: Look around us, Chief. You know what I see? Water. Water leaking through the hull. Water outside the hatch. Water above me, water below me. It\'s all freaking water, Chief. We\'re drowning. Real slow. You want to live out your few remaining days eating fruit on the beach afraid to get your toes wet? PAAL: What is it YOU want? MARGUERIT: I want to know how to get off this freaking planet.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1488, 6, 'Ency_JellyPDAObservatory', 'Baat Torgal\'s Log #1', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1489, 6, 'EncyDesc_JellyPDAObservatory', 'OK, get this. We ran out of enamelled glass we salvaged from the shipwreck so it looked like we couldn\'t build the observatory. And Marguerit, here\'s what she does - she takes the Seamoth out to the kelp forests, armed with just a heatblade, and freaking wrestles a stalker to the seafloor and brings back its teeth. She entered hand-to-hand combat with an alien shark and brought home it\'s TEETH. Now we can fabricate all the enamel we need. On one hand, that is the most badass thing I ever heard, and now I\'m sitting in this sweet observatory watching biters tap harmlessly at the glass. On the other hand, was it worth it? Did that creature survive? How fast do their teeth grow? Is there a way to manufacture materials without harming the ecosystem here? If we had a full size aquarium we could study these lifeforms up close. Find the answers.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1490, 6, 'Ency_JellyPDARoom1Desk', 'Baat Torgal\'s Log #2', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1491, 6, 'EncyDesc_JellyPDARoom1Desk', 'We\'ve been living in this habitat a month now. It used to be exciting, but it\'s more claustrophobic than I thought. There are so many predators in these caves that Marguerit is just about the only person that gets to go out there. All the same, the life down here is INCREDIBLE. Marguerit has been bringing back the wildest specimens you could imagine. OK, the plantlife is inedible. I learnt that the hard way. But the fish... down here they GLOW. There\'s one that\'s 90% eyeball. Snakes the length of two glass corridor sections. It\'s not easy without a proper lab and equipment, but sometimes the old fashioned way - observing, taking notes, testing theories - reveals things a spectroscopic analysis never would. For example, I\'ve been watching the sea snakes that make their homes in the purple mushrooms that grow here. They await their prey, and strike when small herbivores stray too close. What they don\'t consume settles on the seabed, which fertilizes the mushrooms, which feed the herbivores, and the chain continues. Co-evolution just blows my mind.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1492, 6, 'Ency_JellyPDARoom1Locker', 'Paal Torgal\'s Log #2', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1493, 6, 'EncyDesc_JellyPDARoom1Locker', 'You know what Maida asked me today? \'Have you heard of a Cyclops Submarine?\' she asks me. ME. I\'ve hauled starwhals to Neptune, plasteel to the Federation... this family operates nine different mining colonies across the Ariadne Arm. She thinks I don\'t know what a Cyclops is?! She thinks she\'s in charge? Her contract still says otherwise. So she wants to build a habitat at 700m below sea level, a kilometre east of here. And she needs Baat and I to pull it off. She\'s got it into her head that there\'s no rescue coming. That she can save us if she just acts recklessly enough. And I just cannot goddamn tell whether it\'s the stupidest idea I ever heard, or my only hope. I turned 80 years old last week. I thought I had another 80 in me yet. But stuck here, there\'s no swapping out my liver when the old one fails. Down here, I\'m mortal. And I\'m running out of time. So it\'s my responsibility to make a decision. Return to the island and hope whatever knocked the Degasi out of the sky won\'t do the same to the rescue ship, or take us deeper in search of answers. And all the while be hoping old age gets me before the seamonsters do. I\'ll give Maida just one thing. She was right about these caves. There\'s enough lithium here to fabricate a hundred tons of plasteel. Enough for a damn FLEET of submarines. There was nothing anyone could have done to avoid crashing here, but I was right to order the detour. When we get off this planet they\'ll be talking about the Torgaljin Corp. share price on the other side of the Federation.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1494, 6, 'Ency_JellyPDAExterior', 'Marguerit Maida\'s Log #1', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1495, 6, 'EncyDesc_JellyPDAExterior', 'These freaking corporate, bourgeois, inbred, incompetent, self-absorbed ASSHOLES don\'t have a FRIGGING clue. I swear every single thing that comes out of that idiot\'s face is a narcissistic lie. He wants to stay here, his problem. I\'m the one doing the heavy lifting. Screw the contract. Screw the bonus pay. Screw the charges. I\'m building that sub and I\'m going deeper. I\'ve started preparing for the operation. The kid\'s alien petting zoo was worth chipping in for. No need to visit the surface for stalker teeth when he\'s got a whole school of them whipped to eat the fish from the palm of his hand. I\'ve started defanging them when the Torgals are sleeping, and stockpiling enamel and metal ores for construction of the sub. When fracking seamonsters are hunting you, you don\'t run and hide. You hunt the fracking seamonsters. Then you build a bigger boat out of the bones of your vanquished foes and go hunt bigger monsters. Repeat until there aren\'t any monsters left to hunt you.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1496, 6, 'Ency_JellyPDARoom2Locker', 'Degasi Voice Log #6 - Curious Discovery', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1497, 6, 'EncyDesc_JellyPDARoom2Locker', 'PAAL: What is that thing? MARGUERIT: I don\'t know. PAAL: Part of another ship? MARGUERIT: None I\'ve ever seen. BAAT: It\'s in such good condition. It\'s not even scratched. It could originate here, on this planet. PAAL: Don\'t touch it, it could be valuable. I said don\'t touch it! MARGUERIT: Stand down, Chief, I\'m just lookin\'. If it were goin\' to crumble to dust it woulda done so when I picked it up. BAAT: It\'s glowing. PAAL: It\'s still powered? Someone else was here recently. BAAT: Either that, or so long ago that no one remembers.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1498, 6, 'Ency_DeepPDABase3', 'Degasi Voice Log #7', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1499, 6, 'EncyDesc_DeepPDABase3', 'BAAT: Stop it, both of you! We\'re sick. MARGUERIT: What? PAAL: How? BAAT: You\'ve been coughing, right? Feeling itchy? MARGUERIT: Yeah. BAAT: We\'ve been sick since we started breathing the air. PAAL: The suit biometrics would have warned us. BAAT: It\'s something new. A bacterial infection. MARGUERIT: What does it do? BAAT: Nothing much, so far. But it\'s smart. With enough time I think it could begin altering our genetic structure. Things get gross after that. PAAL: What can you do? BAAT: I think I can slow it down. PAAL: How did you find it? BAAT: It\'s everywhere, I just couldn\'t see it. Everything on this planet is infected. It\'s pretty much just part of the ecosystem. MARGUERIT: How bad can it be if everything\'s got it? BAAT: The local lifeforms must have developed coping mechanisms. We haven\'t. PAAL: Yet. You have my full faith, son, that you\'ll figure this out for us. MARGUERIT: Tell me what you need, kid.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1500, 6, 'Ency_Lifepod', 'Standard 2-Berth Emergency Lifepod', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1501, 6, 'EncyDesc_Lifepod', 'Weight: 576 kg Dimensions: 3m x 3m Standard Features: - Low density, high strength construction - Onboard air-break, flotation devices and thrusters, for land, sea or space recovery - Short-range communications relay (250km uninterrupted range) - Solar power - Wall-mounted fabricator - Multiple exits Standard Provisions: 2x All-Environment Protection Suit 1x Handheld spectroscope scanner 3x Ready-to-eat rations 3x 1L drinking water provision 1x Emergency medkit 1x Flashlight 1x Emergency flare 1x Assorted replacement parts', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1502, 6, 'Ency_Readme', 'Readme', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1503, 6, 'EncyDesc_Readme', 'If you are reading this, then you have survived an emergency evacuation of a capital-class ship equipped with Alterra technology. Congratulations: the hard part is over. Your PDA has automatically rebooted in Emergency Mode. This operating system has one purpose: to keep you alive. It features: - Full integration with user biometrics for timely survival advice - Blueprints for fabricating a range of essential survival equipment - Onboard microphone, camera and OCR technology for short-range (20m) situational analysis - Cross-compatibility with the Alterra handheld spectroscope scanner Follow its directions and we will bring you home alive. NB Your personal and work files have been encrypted and may be retrieved at a later date by a licensed engineer.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1504, 6, 'Ency_SurvivalChecklist', 'Survival Checklist', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1505, 6, 'EncyDesc_SurvivalChecklist', '1. Administer first aid if required 2. Survey the environment 3. Locate other survivors 4. Assess food and water availability and decide on rations 5. Check lifepod for damage, and repair as necessary 6. Broadcast local distress signal using lifepod\'s short-range communications relay 7. Gather and take stock of available materials 8. Use survival equipment to render the local environment habitable 9. Maintain physical and psychological health until rescue NB This information is meant as a general guide. In the first instance you should always follow the advice of your PDA, which has taken your particular circumstances into account.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1506, 6, 'Ency_AuroraOverview', 'Aurora Long-Distance Vessel Overview', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1507, 6, 'EncyDesc_AuroraOverview', 'Mission: Ariadne Arm Phasegate Installation, 3 year operation time Crew: Command Team (23), Engineering Team (85), Support Crew (40), Passengers (9) Facilities: - Dark-matter ion drive V8 - Engineering section with A Grade facilities (incl manned robotics suite and full scanner range) - 0.25 cubic kilometers storage for phasegate installation apparatus - Habitation section with C+ Grade leisure facilities.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1508, 6, 'Ency_AEPSuit', 'All-Environment Protection Suit', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1509, 6, 'EncyDesc_AEPSuit', 'The Alterra AEP Suit: A single solution for a universe of infinite danger You are currently wearing the AEP suit - a hermetically-sealed personal environment, designed to withstand the most extreme conditions in the known universe. - Onboard temperature and hydration regulation - Compatible with a range of modifications for particular environments - Slimline build for maximum freedom of movement - Biometric sensors - Contextual heads-up display AEP suits should always be equipped BEFORE lifepod launch in case of hull breach.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1510, 6, 'Ency_MetalSalvage', 'Structural Analysis: Scattered Wreckage', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1511, 6, 'EncyDesc_MetalSalvage', 'Analysis confirms this wreckage is from the Aurora. Outer layers of the material have oxidized, suggesting it has been heated to over 1200 Celsius. This pattern is consistent with hull disintegration during atmospheric entry. Inner layers contain enough residual titanium to be reclaimed at the fabricator.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1512, 6, 'Ency_Airsack', 'Airsack', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1513, 6, 'EncyDesc_Airsack', '1. Semi-permeable membrane: Body consists of an oxygen- and water-filled, semi-permeable membrane. No oral cavity detected. Membrane may filter plant matter from the water. 2. Open-ended vascular tubing: Can be angled and contracted to pump out water and achieve low-velocity, guided propulsion. No fins identified. 3. Mostly oblivious to threats, its only identified defense mechanism: it is 95% cartilage. Assessment: Membrane may have applications as a natural water filter', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1514, 6, 'Ency_RabbitRay', 'Rabbit Ray', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1515, 6, 'EncyDesc_RabbitRay', 'A herbivorous aquatic lifeform with highly poisonous flesh. 1. Undulating wings: Main mode of transportation. 2. Poisonous flesh: Large and without other defense mechanisms, the rabbit ray appears to have evolved poisonous flesh to ward off predators. 3. Diet: Grasses and kelps. Assessment: Inedible but friendly', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1516, 6, 'Ency_AcidMushroom', 'Acid Mushroom', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1517, 6, 'EncyDesc_AcidMushroom', 'A common, spore-bearing fungi species, with developed defense mechanisms. The flesh contains a highly acidic compound which leaches into the water if the outer skin is penetrated. Fluctuations in the local water pressure may also cause it to shrink. It is not clear which predator species necessitated such extreme counter-measures, but the acid mushroom\'s numbers suggest it has successfully deterred most of them. Assessment: Inedible, but exploitable in battery fabrication if picked carefully', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1518, 6, 'Ency_LimestoneOutcrops', 'Limestone Outcrops', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1519, 6, 'EncyDesc_LimestoneOutcrops', 'These unusual geological structures often form around titanium and copper deposits, and are distinct to this planet. Closer analysis reveals the stone around the metal has been hardened against erosion, but the mechanism remains unknown. Assessment: Titanium and copper source', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1520, 6, 'Ency_SandstoneOutcrops', 'Sandstone Outcrops', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1521, 6, 'EncyDesc_SandstoneOutcrops', 'These common, porous outcrops seem to form around small amounts of precious metals, or otherwise these metals are part of a sedimentary buildup over time. Assessment: Silver and gold source', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1522, 6, 'Ency_ShaleOutcrops', 'Shale Outcrops', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1523, 6, 'EncyDesc_ShaleOutcrops', 'This sedimentary rock is formed from flakes of clay minerals, inside of which rare metals such as lithium can be found. Geological conditions on this planet mean it tends to be found in deeper biomes. Assessment: Gold and lithium source', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1524, 6, 'Ency_BasaltOutcrops', 'Basalt Outcrops', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1525, 6, 'EncyDesc_BasaltOutcrops', 'Hard, igneous rock, formed by past volcanic activity. Likely to contain very rare minerals, such as diamond and uranium, which cannot be found elsewhere. Assessment: Gold, diamond and uranium source', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1526, 6, 'Ency_BrainCoral', 'Purple Brain Coral', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1527, 6, 'EncyDesc_BrainCoral', 'A permanent, growing colony of microscopic organisms. This coral species has adapted to filter carbon dioxide from the environment, using the carbon to build the colony, and expelling the oxygen from specialized exhaust funnels. Assessment: Exploitable', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1528, 6, 'Ency_Peeper', 'Peeper', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1529, 6, 'EncyDesc_Peeper', '1. Overdeveloped, side-mounted eyes: Well-adapted to recognize and flee its many predators. Also rich in protein. 2. Powerful tail fin: Enables rapid acceleration, and the ability to leap meters out of the water. 3. Narrow dorsal fins: Enhance maneuverability. Reliance on visually identifying predators may leave it vulnerable in low-light environments. Assessment: Edible and substantial - if you can catch it', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1530, 6, 'Ency_Boomerang', 'Boomerang', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1531, 6, 'EncyDesc_Boomerang', '1. Twin-fins: Unusually, this species\' two fins are a cartilaginous extension of its skeleton. Less prone to damage, harder to grow back. 2. Serrated teeth: Suggests adaptation for grinding coral. 3. More active during daylight hours, and prone to flee on approach. Assessment: Edible, meager but reliable', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1532, 6, 'Ency_Garryfish', 'Garryfish', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1533, 6, 'EncyDesc_Garryfish', 'Slow-moving and curious herbivore. 1. Camouflage indicates adaptation for evasive behavior on the ocean floor. 2. Eye stalks may be beneficial when watching for predators from hiding places amongst the coral. 3. Large stomach cavity: Feeds all day during daylight hours, leaving very little edible meat. Assessment: Not as edible as it looks', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1534, 6, 'Ency_Shuttlebug', 'Shuttlebug', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1535, 6, 'EncyDesc_Shuttlebug', '1. Three legs: High strength muscles can propel the lifeform great distances through the water, as well as ambulating them across the sea floor. 2. Three mandibles: Used to orient themselves when drifting, and to filter through detritus on cave floors. Their presence may indicate a nearby cave system. Assessment: Essential recycler in the food chain', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1536, 6, 'Ency_Gasopod', 'Gasopod', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1537, 6, 'EncyDesc_Gasopod', 'A slow-moving lifeform capable of filling the water with a poisonous and corrosive compound capable of dissolving even synthetic fibers. 1. Algae gland - A bulbous, sack-like appendage on the rear end. A species of luminescent yellow algae grows inside the sack and produces the poisonous compound. 2. Abdominal muscles: Contract when the creature is frightened, causing the gland to emit the noxious compound into the surrounding water. 3. Filtration system: Multiple gill layers appear to render this creature impervious to the noxious clouds it produces. Assessment: Avoid', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1538, 6, 'Ency_Floater', 'Floater', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1539, 6, 'EncyDesc_Floater', 'Evolutionary abnormality. Further research required. 1. Dominant lifeform: Structural analysis reveals that this entity is made up of two separate species. The pink main body and inner jaws are the dominant creature. 2. Microorganism membrane: The outer, gel-like substance is a mesh of microorganisms capable of forming a sealed vacuum around the creature\'s jaws. 3. Air buffer: A thin layer of helium is stored within the outer membrane, providing buoyancy. Lifeform has been observed almost exclusively attaching to large boulders. Appears entirely vulnerable to artificial detachment, and indiscriminate in what it is re-attached to. Assessment: More information needed', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1540, 6, 'Ency_Holefish', 'Holefish', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1541, 6, 'EncyDesc_Holefish', '1. Coloration suggests adaptation for cave environments. 2. Bored-out Tail Fin: By manipulating the size and shape of the hole in its tail it can perform unpredictable maneuvers. Smaller than most other herbivores, presumably due to lack of vegetation in low-light environments. Shows little fear of predators. Assessment: Edible, reliable cave food', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1542, 6, 'Ency_CaveCrawler', 'Cave Crawler', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1543, 6, 'EncyDesc_CaveCrawler', 'Agile, territorial carrion-feeder. 1. Four legs: Used to walk along the seabed and cling to walls. Equally well adapted for land. 2. Gas exchange membrane: Absorbs essential gases from the air or water. This species seeks out corpses in packs, before defending its claim while the corpse is devoured. Assessment: Inconvenient, particularly at funerals', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1544, 6, 'Ency_TableCoral', 'Table Coral', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1545, 6, 'EncyDesc_TableCoral', 'Each disk is an individual colony of microorganisms, filtering nutrients from the water flowing past. Growth patterns indicate the colonies are in direct competition for positions with superior current or light. Unlike other coral species its structure is malleable, softly pulsating as it pumps nutrients to its extremities, and only turning rigid when it senses physical assault. The jewel-like nodes in the surface are concentrated build-ups of rare minerals the coral is unable to process. Assessment: Exploitable in computer chip fabrication', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1546, 6, 'Ency_HangingStinger', 'Drooping Stinger', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1547, 6, 'EncyDesc_HangingStinger', '1. Zero photosynthetic cells detected. Implies carnivorous adaptation to low-light environments. 2. Follicles along the tentacles capable of detecting contact with foreign bodies, triggering an electromagentic charge in the 600 watt range. Prey is likely paralyzed and consumed over many weeks. Prey: Small fish Assessment: Avoid', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1548, 6, 'Ency_Hoopfish', 'Hoopfish', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1549, 6, 'EncyDesc_Hoopfish', '1. Small size, school mentality, prey fish. 2. Antennae: Rather than swimming this lifeform uses the fine green antennae which encircle its body to alter the composition of the water in front of it, allowing it to \'sail\' into the low density space created. Assessment: Edible but meager', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1550, 6, 'Ency_CoralSample', 'Common Corals', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1551, 6, 'EncyDesc_CoralSample', 'The giant coral tubes and slanted shell plates appear to be different solutions to the same problem of maximizing water and nutrient flow throughout the colony. Despite external differences these structures are built by very similar organisms on similar principles. Samples are rich in calcium. Assessment: Exploitable in bleach fabrication', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1552, 6, 'Ency_Crash', 'Crash', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1553, 6, 'EncyDesc_Crash', '1. Impact-sensitive spikes: If the lifeform collides with something at sufficient speed these spikes are impacted, triggering an internal chemical reaction. 2. Suction snout: Likely adapted to vacuum up small insects and grubs in cave systems. 3. Chemical storage organ: concentrations of sulfur build up in this organ over time, and can be deployed as an explosive last line of defense during the nesting phase. Data points to an evolved symbiosis with the crash plant. Hypothesis: the plant evolved to feed on sulphuric compounds secreted by the crash. Stronger, more protective plants provided superior nesting grounds, which in turn benefited the plant with more nutrients, and the co-operative cycle continued. Assessment: Avoid or incapacitate', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1554, 6, 'Ency_CrashLair', 'Crash Plant', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1555, 6, 'EncyDesc_CrashLair', 'This plant species appears to share a symbiotic relationship with the aquatic lifeform that nests inside it. The petal-like structures appear undamaged when the lifeform emerges, and likely remain open until the nest is reclaimed by the original owner, or another. Further information on this relationship is not possible from studying the plant in isolation. Trace amounts of a sulphuric residue have been detected on the inner leaves. Assessment: Exploitable', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1556, 6, 'Ency_Creepvine', 'Creepvine', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1557, 6, 'EncyDesc_Creepvine', 'A kelp species concentrated in large forests, in shallow, sandy waters. Loose roots anchor the plant to the sea floor, from where it grows steadily toward the surface in pursuit of sunlight. The stem is fibrous and rich in iron, making it both a viable food stuff, and base material for fabrication of textiles such as rope and bandages. Predators: Hoverfish, eyeye, rabbit ray, peeper Assessment: Vital alien resource - Edible - Medicinal - Construction Applications', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1558, 6, 'Ency_CreepvineSeeds', 'Creepvine Seeds', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1559, 6, 'EncyDesc_CreepvineSeeds', 'Mature creepvine plants that have survived the predation of small herbivores produce these bioluminescent seed clusters, which may be knocked loose by currents or consumed and later deposited by predators. The embryo is surrounded by a thick oil layer which would disperse into the ground as the outer skin deteriorated. This may provide the seedling with the nutrients it needs to survive the low-light conditions on the sea bed. Assessment: Exploitable oils', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1560, 6, 'Ency_Eyeye', 'Eyeye', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1561, 6, 'EncyDesc_Eyeye', 'An extreme evolutionary adaptation where 90% of the body mass is dedicated to the ocular cavity. - Specialized in identifying its predators in low-light environments long before they come into range - No brain, just a nervous system - Too stupid to avoid predators at close range - Vulnerable to surprise attack, implies natural prey of the sand shark Assessment: Edible and easy to catch once spotted', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1562, 6, 'Ency_Hoverfish', 'Hoverfish', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1563, 6, 'EncyDesc_Hoverfish', 'Six unique limb appendages feature charged pads capable of ionizing the surrounding water. The hoverfish appears to use this ability to maintain its position against the current as it feeds from kelp and lichen. Assessment: Edible, a healthy staple', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1564, 6, 'Ency_Biter', 'Biter', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1565, 6, 'EncyDesc_Biter', 'Small, aggressive specimen. 94% muscle, 4% connective tissue, 2% brain. - Overdeveloped tail fin favors out-pacing and outnumbering their prey over individual maneuverability - Specialized olfactory stalk on its head for detection of bodily fluids in the water - Likely indiscriminate when hunting: anything injured is fair game - Secondary pair of eyes bear similarities to the sand shark\'s. Likely dedicated to detecting the peripheral movement of larger predators. Prey: Small herbivores; but according to calculations creatures up to 100x the biter\'s body weight could succumb to a focused pack. Assessment: Lethal without proper precautions - Avoid packs - Try not to bleed', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1566, 6, 'Ency_Stalker', 'Stalker', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1567, 6, 'EncyDesc_Stalker', 'A streamline predator with developed intelligence and strength. - Found in the kelp forests, in wait of prey leaving the safety of the shallows - Retinal layering suggests adaptation for night-time hunting - Neural pathways indicate innate ability for reward-based learning; evolutionary explanation unclear at this time - Attracted to metals. Will fight fiercely over its hoard. No explanation available for this behavior. Further research required. Prey: Evolutionary profile fits natural predator of the peeper Assessment: Coerce or avoid', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1568, 6, 'Ency_SandShark', 'Sand Shark', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1569, 6, 'EncyDesc_SandShark', 'A segmented exoskeleton makes this a slow but powerful predator. The rows of feet on the lifeform\'s underside are ill-designed for ambulation - instead they are used to disturb the surface of the sand so the lifeform can burrow into the ground, from where it may ambush its prey. Prey: Herbivores up to twice its size Assessment: Avoid suspicious sand clouds', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1570, 6, 'Ency_Bleeder', 'Bleeder', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1571, 6, 'EncyDesc_Bleeder', 'A simple parasitic organism, little more evolved than the common tick. Identifying features include a ductile sack on its rear end for collection and digestion of blood; and a jaw with rows of teeth and mandibles used to attach to the skin of its victims. Prey: Known to target live organisms, the bleeder\'s low speed and poor defenses suggest they have evolved primarily as carrion feeders. Assessment: Inconvenient and unhygienic', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1572, 6, 'Ency_StalkerTooth', 'Stalker Behavior & Physiology', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1573, 6, 'EncyDesc_StalkerTooth', 'Extended analysis of stalker dental samples has been completed. In other local lifeforms tooth composition follows a familiar biological process whereby a calcified structure is grown in the gum. Stalker teeth are unique in exhibiting extraordinary lightness and strength, and containing only trace amounts of calcium. They gain their structural integrity from a titanium/iron compound somehow produced in the stalker\'s body. This suggests some possible explanations for the creature\'s metal-gathering behavior, but raises more questions: - By what process can the stalker convert raw metals into dental structure? - What explains this seemingly costly evolutionary adaptation? An armored opponent? A calcium shortage? Assessment: More research required.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1574, 6, 'Ency_Spadefish', 'Spadefish', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1575, 6, 'EncyDesc_Spadefish', 'A common herbivore that seems to avoid shallower waters in favor of swimming near to the seabed from where it can keep its one eye on would-be predators in the water above it. Recently observed specimens have high concentrations of a poisonous enzyme - may be a seasonal stage of their lifecycle. Continue to observe. Assessment: Edible, substantial', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1576, 6, 'Ency_Reginald', 'Reginald', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1577, 6, 'EncyDesc_Reginald', 'A common prey fish. Dull green coloration for deep water camouflage. Luminescent tail coloration likely part of mating behavior. Filters loose algae and other plant material from the water via four gill-like, front-mounted orifices. Assessment: Edible, substantial', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1578, 6, 'Ency_TigerPlant', 'Tiger Plant', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1579, 6, 'EncyDesc_TigerPlant', 'This plant has adapted to sense fluctuations in the water at up to 15m, and is capable both of prehensile movement of its tubes, as well as the propelling of thorns at speeds of up to 10m/s. Although capable of incapacitating small herbivores, this plant lacks carnivorous digestive organs. Would-be predators caught in its defensive perimeter serve as a warning to other herbivores not to approach; and then as they decompose they serve as fertilizer for the tiger plant. Assessment: Avoid or incapacitate', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1580, 6, 'Ency_BloodGrass', 'Blood Grass', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1581, 6, 'EncyDesc_BloodGrass', 'A common sea grass adapted to shallow, sandy environments. - Likely to grow wherever the ground is too loose or the ocean surface too far for creepvines to take hold - Commonly found growing on the crests of dunes and atop raised plateaus for superior access to sunlight - Distinctive red coloration may be an adaptation to low wavelength light on the seabed, a deterrent against predators, or both - Insufficient calories for human consumption Predators: Reginald, spadefish, boomerang Assessment: Presence supports healthy biodiversity', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1582, 6, 'Ency_TreeLeech', 'Tree Leech', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1583, 6, 'EncyDesc_TreeLeech', 'Parasitic, fungus-like growth found attached to other fauna. An enzyme is released by the organism which dissolves a hole in the skin of the host, from which it leeches nutrients directly. Outer, tooth-lined jaw serves no identified purpose. May be used during a different stage of the organism\'s lifecycle? Assessment: Exploitable fungal enzymes', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1584, 6, 'Ency_TreeMushroom', 'Tree Mushrooms', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1585, 6, 'EncyDesc_TreeMushroom', 'Analysis of these large organic structures reveals a microcosm of co-operating, co-habiting and competing lifeforms. The main trunk is a species of coral, some colonies up to 50,000 years old. The caps which line it share more in common with earth fungi. Other organisms grow on the structure wherever there is space and light. Surrounding waters are dense with herbivorous lifeforms in the 1mm - 10mm range, to the extent that larger herbivores appear to have mostly abandoned the area. Assessment: Exploitable', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1586, 6, 'Ency_Jellyray', 'Jellyray', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1587, 6, 'EncyDesc_Jellyray', 'Shares some evolutionary traits with the rabbit ray, including highly poisonous flesh. This species has adapted to low-light environments with a translucent, luminescent body. This may help to: - Light up the surrounding area for foraging - Ward away predators - Identify the organism to others of its kind Smaller creatures have been seen swimming in the jellyray\'s wake to take advantage of the light source for their own ends. Assessment: Inedible', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1588, 6, 'Ency_Mesmer', 'Mesmer', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1589, 6, 'EncyDesc_Mesmer', 'Small, carnivorous lifeform with a unique hunting mechanism that allows it to catch prey twice its size. The mesmer waits until a larger carnivore approaches before opening its outer wings. Predators become transfixed by the shimmering pattern, at which point the mesmer opens the jawlike recess in its protective shell and attempts to eat its victim alive, or incapacitate it long enough to escape. Assessment: Avoid', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1590, 6, 'Ency_Reefback', 'Reefback', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1591, 6, 'EncyDesc_Reefback', 'Armor plating on these huge lifeforms is thick enough to interfere with the spectroscope scanner. Limited data available. Size ranges upwards of 20m. Tentacles provide low speed propulsion. Sociable, seen traveling in small pods. Profile consistent with a herbivore near the top of the food chain. Predators: Unknown Assessment: None at this time', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1592, 6, 'Ency_ModificationStation', 'Modification Station', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1593, 6, 'EncyDesc_ModificationStation', 'Where the standard fabricator atomically rearranges raw materials to form complex devices, the mod station is able to combine complex devices to enhance their function. Most industrial vessels are fitted with a complement of equipment modification stations, which enable engineers to adapt their tools for emergent situations on the fly. To conserve hard drive space the modification station is excluded by default from most personal emergency blueprint libraries; however extreme environments such as ocean and desert class planets may necessitate the adaptation of basic survival tools (such as the knife and oxygen tanks) for unanticipated applications. For this reason access to a mod station is always recommended.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1594, 6, 'Ency_StasisRifle', 'Stasis Rifle', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1595, 6, 'EncyDesc_StasisRifle', 'The stasis rifle uses patented technology to slow time in a specified area to as near to a full stop as the laws of physics will permit. It is an advanced, handheld tool designed to facilitate scientific and engineering operations by expanding the window of opportunity for action in time-sensitive scenarios. Common applications include: - Slowing fast-moving mechanisms, such as fan belts, to facilitate maintenance operations - Pausing the biological processes of organisms for closer study - Halting the progress of fires and flooding - Navigating perilous spaces by freezing potential threats The stasis rifle features an independent, replaceable power cell, and the trigger may be held down to increase the area of effect and duration. Due to high power consumption and non-lethality, conventional weapons are recommended for personal defense.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1596, 6, 'Ency_PropulsionCannon', 'Propulsion Cannon', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1597, 6, 'EncyDesc_PropulsionCannon', 'The propulsion cannon allows technicians to manipulate gravitational forces at ranges of up to 20m. It is commonly used in construction and mining to move materials. Operating Instructions: - Pull the trigger once to lock onto and attract a single targeted object weighing less than 25kg - The object can now safely be retrieved from the gravitational beam - Alternatively, pull the trigger a second time to propel the object at speed away from the device - Not recommended for use on organic subjects', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1598, 6, 'Ency_Seamoth', 'Seamoth', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1599, 6, 'EncyDesc_Seamoth', 'The seamoth is a one-person submersible with an independent, replaceable power cell and a fully customizable design. Most long-range mining vessels carry at least two submersibles of this class to facilitate the exploration and exploitation of water-bearing planetoids. Ratings: - Top Speed: 13m/s - Acceleration: 5m/s/s - Distance per power cell: 10km - Crush depth: 225m below sea level - Upgrade module slots: 4 - Dimensions: 3m x 1.5m x 1m - Persons: 1 Seamoths may be modified by installing upgrade modules to the access point mounted by default on the upper left wing. These include: - Increased cargo storage - Superior power - Pressure and collision compensation - Enhanced sonar - Defensive capabilities NB These modules may only be manufactured at an appropriately outfitted moonpool or submersible bay.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1600, 6, 'Ency_SeamothConfigs', 'Seamoth Configurations Catalog', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1601, 6, 'EncyDesc_SeamothConfigs', 'Cargo Hauler: 3x storage; 1x solar charger Scout: 1x pressure compensator; 1x power efficiency; 1x perimeter defense; 1x sonar; Tank: 1x perimeter defense; 1x torpedo system; 2x hull reinforcement', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1602, 6, 'Ency_Builder', 'All-terrain Quick-build Habitats', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1603, 6, 'EncyDesc_Builder', 'The Alterra handheld habitat builder has been an essential tool of xenoscientists, colonists and emergency relief crews across seven different empires for more than 50 years. Habitat modules are hermetically sealed from the outside environment, and may be built on land, underwater, or in a vacuum. Oxygen and power systems are not fitted as standard and must be built separately. Most capital ships carry a full complement of advanced modules and reactors for quick deployment in the field. Habitats can be enhanced to become long-term homes, remote research stations, defensive outposts and more.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1604, 6, 'Ency_Moonpool', 'Moonpool', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1605, 6, 'EncyDesc_Moonpool', 'The moonpool is an essential habitat module for long-term exploration of oceanic environments. Its primary function is as a dry dock for the seamoth submersible (seamoth not included). The large central chamber contains a pressurized pool which provides ready access to the surrounding waters, and comes as standard with equipment for raising and recharging the seamoth. It is recommended the builder tool be used to outfit the moonpool with a seamoth modification station at your earliest convenience. This will enable the fabrication of seamoth upgrade modules, amongst other things. Ratings: - Dimensions: 16m x 10m x 5m - Connection points: 6 - Habitat hull strength liability at sea level: -5 (equivalent 4 rooms) - Capacity: 1 seamoth - High power consumption', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1606, 6, 'Ency_BasePlanter', 'Planters & Pots', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1607, 6, 'EncyDesc_BasePlanter', 'Interior planters come in a variety of configurations, and allow for most plant species to be grown in small numbers. For decorative or botanical use.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1608, 6, 'Ency_FarmingTray', 'Exterior Growbed', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1609, 6, 'EncyDesc_FarmingTray', 'Advanced synthetic soils allow this growbed to support a huge variety and quantity of alien plantlife, and it can be installed anywhere on land or underwater where there is space.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1610, 6, 'Ency_PlanterBox', 'Interior Growbed', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1611, 6, 'EncyDesc_PlanterBox', 'Designed for use exclusively inside regulated habitat modules, the interior growbed is more compact than the outdoor version.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1612, 6, 'Ency_WaterFilter', 'Water Filtration Machine', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1613, 6, 'EncyDesc_WaterFilter', 'The filtration system draws water unfit for human consumption from an external source, atomically splits it into its constituent parts and outputs consumable liquid water and salts while disposing of any harmful by-product. It can be built in any compatible habitat module, but has substantial power requirements.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1614, 6, 'Ency_Techlight', 'Floodlight', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1615, 6, 'EncyDesc_Techlight', 'The standard issue floodlight is battery-powered, and designed to focus a bright beam of light in a single direction, useful in all kinds of industrial and emergency operations. Functions in all known environments. The battery is replaceable.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1616, 6, 'Ency_LEDLight', 'Light Stick', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
  (1617, 6, 'EncyDesc_LEDLight', 'A mobile, battery-powered LED light, which provides low-level lighting in a 360 degree area, and can be attached to most surfaces.', '2016-10-20 01:27:15', '2016-10-20 01:27:15'),
